import React from "react";
import "./track.scss";

class Track extends React.Component {
  state = {};
  render() {
    return (
      <div className="track">
        <span>{this.props.id}</span>
        <span>{this.props.info.image}</span>
        <span>{this.props.info.title}</span>
        <span>{this.props.info.album}</span>
        <span>{this.props.info.date}</span>
        <span>{this.props.info.time}</span>
      </div>
    );
  }
}

export default Track;
